import {Login} from "./components/login";
import {Running} from "./components/running";
import {Course} from "./components/course";
import {Insrtuctor} from "./components/instructor";
import Route from "react-router-dom";


import React from "react";
import './App.css';

function App() {
  //write routes here
  return (
    <div>
      <Route path="/login" component={Login} />
      <Route path="login/running" component={Running} />
      <Route path="login/course" component={Course} />
      <Route path="login/instructor" component={Insrtuctor} />
    </div>

  );

}

export default App;
